import { 
    createStore,
    applyMiddleware
} from "redux";
import rootReducer from '../reducers';
import { banWords } from "../middleware";

const forvidenWords =  [
    "hola",
    "buen",
    "dios"
]
    
const store = createStore(
    rootReducer,
    applyMiddleware(banWords));
 
export default store;
